import React from 'react';
import styled from 'styled-components';

const Footer: React.FC = () =>{
    return(
        <FooterWrap>
            this is footer
        </FooterWrap>
    );
}

const FooterWrap = styled.div`
    width:1180px;
    border:1px solid;
    margin: 0 auto;
`;

export default Footer;
